    true,nt"url": null,nt"notes": "&lt;p&gt;rnt&lt;strong&gt;&lt;u&gt;Methodology&lt;/u&gt;&lt;/strong&gt;&lt;/p&gt;rn&lt;p&gt;rntThe
    approach is highly focused and well conceived.&amp;nbsp; Two rocket payloads will
    be launched under day and night conditions to study the mass and height distributions,
    and charging of the MSPs. These will be launched in the Fall period to study the
    characteristics of the MSPs without the complications introduced by the presence
    of NLCs and other phenomena containing ice droplets.&amp;nbsp; The campaign has
    been selected for And&amp;oslash;ya Rocket Range&amp;nbsp; (ARR) in Norway because
    of the nearby ALOMAR Observatory, which is composed of several critical lidars and
    radars for support of this mission.&amp;nbsp; The program is a follow-on to an earlier
    program conducted from ARR in 2007.&amp;nbsp; In this case, the prime instrument
    is the MASS or aerosol mass analyzer, which has been improved to increase the mass
    range of particles observed in the earlier mission. It is accompanied by Faraday
    rotation radio propagation experiment to measure electron density, a positive ion
    probe pair, a payload potential measurement, UV and photoelectric measurements and
    dust detectors.&lt;/p&gt;rn",nt"license_title": "U.S. Government Work",nt"extras":
